export const getJwtUser = () => {
    return {userToken: 'bearer ' + localStorage.getItem('userToken'),
            ID: localStorage.getItem('UserID')
  }
  };

  export const getJwtAdmin = () => {
    return {userToken: 'bearer ' + localStorage.getItem('adminToken'),
            ID: localStorage.getItem('AdminID')
  }
  };
